    for(int i = 3; i*i < MAX; i+=2)
    {
        if(prime[i]==0)
        {
            for(int j = i*i; j < MAX; j+=i)
            prime[j]=1;
        }
    }

    for(int i = 2; i < MAX; i++)
        if(prime[i]==0)
            allPrimes.push_back(i);// sob prime rakhlam p vector e

}

vector<ll>findPrimeFactors(ll n)
{
    vector<ll> primeFactors;
    while (n%2== 0) primeFactors.push_back(2), n = n/2;
    for (ll i = 3; i*i <= n; i = i+2)
    {
        while (n%i == 0)
        {
            primeFactors.push_back(i);
            n = n/i;
        }
    }
    if (n > 2) primeFactors.push_back(n);
    return primeFactors;
}

vector<long long> allDivisiors(long long n){
    vector<long long>divisors;
    for(ll i=1; i*i<=n; i++){
        if(n%i==0){
            if(n/i==i) divisors.push_back(i);
            else divisors.push_back(i), divisors.push_back(n/i);
        }
    }
    return divisors;
}

bool isPrime(ll n)
{
    if(n==2 or n==3) return true;
    if(n%2==0) return false;
    for(ll i=3; i*i<=n; i+=2) if(n%i==0) return false;
    return true;
}

ll nsum(ll n){
    return (n*(n+1))/2;
}

ll power(ll n, ll p)
{
	if(p==0) return 1;
	if(p==1) return n;
	ll ans=1;
	while(p){
	    if(p&1) ans=ans*n;
        n=n*n;
        p=p/2;
	}
	return ans;
}

ll mpower(ll n, ll p, ll mod)
{
	if(p==-1) p=mod-2;
	if(p==0) return 1;
	if(p==1) return n;
	ll ans=1;
	while(p){
		if(p&1) ans=((ans%mod)*n)%mod;
        n=((n%mod)*(n%mod))%mod;
		p=p/2;
	}
	return ans;
}

bool isPalindrome(string s){
	int N = s.sz;
	for0(i,N/2){
		if(s[i]!=s[N-1-i]) return 0;
	}
	return 1;
}

ll stringToInt(string s){
	ll pow10=1;
	ll ans=0;
	forba(i, s.sz-1, 0){
		ans += (s[i]-'0')*pow10;
		pow10*=10;
	}
	return ans;
}

