/// bitmask related things
/// pos is 0 based index and starts from left to right: [32 31 30 ... ... ... 3 2 1 0]

ll onbit(ll N, ll pos){
    return N = N | (1<<pos);
}
ll offbit(ll N, ll pos){
    return N = N & ~(1<<pos);
    //or return N = N & !(1<<pos);
}
ll flipbit(ll N, ll pos){
    return N = N ^ (1<<pos);
}
bool checkbit(ll N, ll pos){
    return (bool)(N & (1<<pos));
}

